Australian Naval Infrastructure

Australian Naval Infrastructure Pty Ltd (ANI) was established by the Government of Australia to support the Commonwealth’s continuous naval shipbuilding program by being the owner, developer and manager of infrastructure and related facilities at the Osborne Naval Shipyard.

ANI is responsible for the design and construction of the Nuclear-Powered Submarine Construction Yard (NPSCY) - one of the largest and most complex infrastructure projects undertaken in Australia’s history, to support the build of nuclear-powered submarines under the AUKUS program.

The Senior FP&A Analyst will support the CFO, Financial Planning and Analysis Manager, and broader Finance team through ongoing maintenance of ANI’s corporate financial model, monitoring of cash position, managing project cost control activities relating to the NPSCY as well as assisting with meeting ANI’s statutory and management reporting obligations.  This key role will develop and deliver insights that drive innovation, improve business performance and deliver better ways of working.

Reporting to the Financial Planning and Analysis Manager, specific responsibilities of this important position include:

preparing and maintaining ANI’s Corporate Model (financial forecast) and assisting with the annual Corporate Plan;

monitoring ANI’s cash position through forecasting to determine equity and debt drawdowns;

supporting financial reporting requirements including annual financial reports, monthly and quarterly management reports, and project reports;

completing month-end reconciliations of select GL accounts;

assisting the NPSCY Projects team with data capture, reconciliations and reporting;

delivering fit-for-purpose data analysis across business-as-usual and strategic programs to support decision-making;

identifying and implementing business improvement strategies, including remediation of control weaknesses in financial and operational systems.

Applications are encouraged from ambitious and driven professionals with appropriate tertiary qualifications in accounting, finance or commerce. CA/CPA is preferred but not essential.  Previous experience using TechnologyOne or a similar finance system will be highly regarded, alongside professional experience in infrastructure, utilities or other asset-intensive industries.  Problem solving skills, strong analytical and financial capability and developed commercial acumen will be important to succeed in this role.  Importantly, the successful candidate will be positive, proactive, with excellent interpersonal and communication skills and a desire to innovate.  Interested applicants must be an Australian Citizen and eligible to obtain and maintain required security clearances required for a Defence related facility (NV1).

